import React, { Component } from 'react';
import {Apps ,Container,MainTitle,BtnToggle,BtnChange} from './style.js';


import StatesPrice from './StatesPrice';

class App extends Component {
	
	render() {
	
		return (
			<Apps>
				<Container>
					<p>Our Pricing</p>
					<BtnToggle>
						<span>Annually</span>
						<BtnChange  />

						
						
					</BtnToggle>
					
					<StatesPrice />
				</Container>
			</Apps>
		);
	}
}

export default App;
